from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    """
    Generates a natural language sentence from a list of triples.
    """
    sentence = ""
    subject = ""
    clauses = []
    for triple in triples:
        if not subject:
            subject = triple.subject

        if triple.predicate == "alternativeName":
            clauses.append(f"also known as \"{triple.object}\"")
        elif triple.predicate == "creator":
            clauses.append(f"was created by {triple.object}")
        elif triple.predicate == "fullName":
            clauses.append(f"whose full name is \"{triple.object}\"")
        elif triple.predicate == "foundedBy":
            clauses.append(f"was founded by {triple.object}")
        elif triple.predicate == "keyPerson":
            clauses.append(f"with a key person being {triple.object}")
        elif triple.predicate == "city":
            clauses.append(f"located in {triple.object}")
        elif triple.predicate == "product":
            clauses.append(f"produces {triple.object}")
        elif triple.predicate == "lastAired":
            clauses.append(f"last aired on {triple.object}")
        elif triple.predicate == "starring":
            clauses.append(f"starring {triple.object}")
        elif triple.predicate == "firstAppearanceInFilm":
            clauses.append(f"first appeared in {triple.object}")
        elif triple.predicate == "voice":
            clauses.append(f"voiced by {triple.object}")
        elif triple.predicate == "distributor":
            clauses.append(f"distributed by {triple.object}")
        elif triple.predicate == "birthPlace":
            clauses.append(f"born in {triple.object}")
        elif triple.predicate == "nationality":
            clauses.append(f"is of {triple.object} nationality")
        elif triple.predicate == "award":
            clauses.append(f"received the {triple.object} award")
        elif triple.predicate == "broadcastedBy":
            clauses.append(f"broadcasted by {triple.object}")
        elif triple.predicate == "firstAired":
            clauses.append(f"first aired on {triple.object}")
        elif triple.predicate == "series":
            clauses.append(f"part of the {triple.object} series")
        elif triple.predicate == "child":
            clauses.append(f"has a child named {triple.object}")
        else:
            clauses.append(f"with {triple.predicate} being {triple.object}")

    sentence = f"{subject}, " + ", ".join(clauses) + "." if len(clauses) > 0 else subject + "."
    if len(clauses) > 1:
        sentence = sentence.replace(", ", " and ")
        sentence = sentence.replace("is of", "is")
        sentence = sentence.replace("was created by", "created by")
        sentence = sentence.replace("whose full name", "with a full name")
        sentence = sentence.replace("with a key person being", "with a key person")
        sentence = sentence.replace("with", "and")

    return sentence.rstrip(", ") + "."

